import React from 'react';
import {View,Text,StyleSheet,Button} from 'react-native';

const SearchBar = () => {
    return (
        <View style={styles.background}>
            <Text>Search  Bar</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    background:{
        backgroundColor:'#F0EEEE',
        height:50,
        borderRadius:15,
        marginHorizontal:5
    }
});

export default SearchBar;
